        static VoxelObjListData LoadVoxelObj(VoxelModelName name)
        {
            VoxelObjGridData grid = Editor.VoxelObjDataLoader.LoadVoxelObjGrid(name)[0];
            VoxelObjListData result = new VoxelObjListData(grid);
            return result;
        }

        static void WaterPool(WorldPosition pos, Data.MaterialType fluid)
        {
            Range StoneSize = new Range(2, 4);
            RangeIntV3 area = new RangeIntV3(
                new IntVector3(pos.WorldGrindex.X, 2, pos.WorldGrindex.Z),
                new IntVector3(pos.WorldGrindex.X + Data.RandomSeed.Instance.Next(StoneSize), 2, pos.WorldGrindex.Z + Data.RandomSeed.Instance.Next(StoneSize)));

            World.FillArea(area, Data.MaterialType.NO_MATERIAL);
            area.Max.Y--;
            area.Min.Y--;
            World.FillArea(area, fluid);
        }

